import React, { Component } from "react";
import Navbar from "../../components/navbar";
import Form from "../../components/form";

export default class personalProfile extends Component {
    constructor(props) {
        super(props);
        this.state = {
        }
    }

    componentWillMount() {

        fetch("http://localhost:3001/personal_profile_select")
            .then(res => {

                console.log(res.status);
                if (res.status === 200) { return res.json(); }
                // throw `Invalid Query`
            })
            .then(dbres => {
                testArray = dbres.map(item => {
                    return [
                        item.test_id,
                        item.first_name,
                        item.second_name
                    ];
                });
                console.log("test array " + JSON.stringify(testArray, null, 4));


                this.setState({

                    //testArrayState: testArray,
                    rowData: testArray
                })
            }).catch(err => {
                alert(err);
            })

    }

    render() {
        return (
            <div className="personal-profile">

                {console.log("on personal-profile page ")}
                <Navbar />
                <Form />

            </div>
        )
    }
}
